import React from 'react';
import MySwiper from './MySwiper';


const Result = () => {
  return (
    <div className=" text-white bg-cover bg-center bg-[url('/src/assets/images/bg-5.png')]">


      <div className="container mx-auto px-40 items-center justify-center h-screen gap-6">
        <div>
        <h3 className="text-3xl text-center">
        Реальные результаты
        </h3>

        <a href="#" className="text-3xl text-center bg-yellow-400 hover:bg-yellow-500 active:bg-yellow-600 text-white font-bold py-2 px-12 rounded-2xl shadow-lg">
          GO!
        </a></div>
        <MySwiper />
        

      </div>

      



    </div>
  );
};

export default Result;
